Okay, let's think this through. The task involves a responder deciding whether to accept or reject a proposed split of a combined earning. Several factors likely influence this decision: fairness, the responder's relative contribution, the absolute amount offered, and the responder's sensitivity to unfairness.

Here's a breakdown of the key psychological mechanisms and how they might interact:

1.  **Fairness Perception:** Responders likely evaluate the fairness of the split based on their relative contribution (token\_self vs. token\_opp) and the proposed split (split\_self vs. split\_opp). A larger discrepancy between contribution and received amount might lead to a perception of unfairness.

2.  **Contribution Impact:** The absolute contributions of both the proposer and responder will play a role, and must be considered relative to the total amount of the combined earning.

3.  **Amount Sensitivity:** The absolute amount offered to the responder (split\_self) will likely influence their decision. Even if the split is perceived as somewhat unfair, a sufficiently large amount might be accepted.

4.  **Unfairness Aversion:** Individuals exhibit varying degrees of unfairness aversion. Some might reject even slightly unfair offers, while others are more tolerant. This is a learnable parameter.

5.  **Noise:** There will always be some element of randomness in the choices.

Mathematical Form:

A utility function seems appropriate to capture these interactions. We can define the utility of accepting the offer as a function of fairness, amount offered, and individual unfairness aversion.

U = alpha \* (split\_self / combined\_earning - token\_self / (token\_self + token\_opp)) - beta \* abs(split\_self / combined\_earning - token\_self / (token\_self + token\_opp)) + gamma \* split\_self

Where:
*   `alpha` represents sensitivity to advantageous inequity (i.e. when the responder gets more than is fair)
*   `beta` represents the sensitivity to disadvantageous inequity (when the responder gets less than is fair)
*   `gamma` represents sensitivity to absolute reward.
*   The first component captures the difference between proportional offer to combined earning and the proportional contribution to the combined earning.
*   The second component captures the absolute difference between the proportional offer and proportional contribution.
*   The third component captures the impact of the absolute reward.

Here's the model specification:

